import React from 'react';
import { Component } from "react";
import { Link } from 'react-router-dom';
import { BrowserRouter } from 'react-router-dom';
import  MenuRoutes from "./MenuRoutes"

//To jest pierwszy komponent dla menu opartego na komponentach klasowych

interface Props {
};

interface State {
}


class MenuClass extends Component<Props, State> {

    constructor(props: Props) {
        super(props);
    }

    render() {
        return (

            <BrowserRouter>
                <div>
                    <p>Wybierz opcję w menu opartym na komponentach klasowych:</p>
                    <ul>
                        <li><Link to='/'>Główny</Link></li>
                        <li><Link to='/contact'>Kontakt</Link></li>                        
                        <li><Link to='/moreinfo'>Wiecej informacji</Link></li>                        
                    </ul>
                    <hr />
                    <MenuRoutes />
                    <hr />
                </div>
            </BrowserRouter>
        );
    }
}

export default MenuClass;
